import java.awt.image.BufferedImage
import javax.imageio.ImageIO
import java.io.File

def loadImage(imagePath: String): BufferedImage = {
  ImageIO.read(new File(imagePath))
}

def resizeAndGrayScale(image: BufferedImage, width: Int, height: Int): BufferedImage = {
  val newImage = new BufferedImage(width, height, BufferedImage.TYPE_BYTE_GRAY)
  val graphics = image.getGraphics()
  graphics.drawImage(image, 0, 0, width, height, null)
  graphics.dispose()
  newImage
}

def getPixelsAsArray(image: BufferedImage) : Array[Double] = {
  val width = image.getWidth
  val height = image.getHeight
  image.getData.getPixels(0, 0, width, height, Array.ofDim[Double](width * height))
}

def extractPixelArrays(imagePath: String, width: Int, height: Int): Array[Double] = {
  val originalImage = loadImage(imagePath)
  val processedImage = resizeAndGrayScale(originalImage, width, height)
  getPixelsAsArray(processedImage)
}

